import React from 'react'
import styles from '../styles/ContactForm.module.css'
const ContactForm = () => {
    return (
        <div>
            <div className={styles.contactForm}>
                <label>your name</label>
            <input type="text"  placeholder="Your name.."/>
            </div>
        </div>
    )
}

export default ContactForm
